import React, { useState } from 'react';
import LoginForm from './LoginForm';

const LoginWrapper = () => {
  const [user, setUser] = useState(null);

  const handleLogin = (username) => {
    setUser(username);
  };

  return (
    <div>
      <h2>Login Page</h2>
      <LoginForm onLogin={handleLogin} />
      {user && <p>Welcome, {user}!</p>}
    </div>
  );
};

export default LoginWrapper;
